/**
 * 延迟计算实体对象
 * 回调函数中显式获取entity对象时，会触发计算
 */
export class EntityProxy {
    constructor(object: any, intersection: any);
    /** @private */
    private _hasComputed;
    _object: any;
    _intersection: any;
    _computeEntity(): any;
    get entity(): any;
    _entity: any;
    get intersection(): any;
}
